import React from 'react';

const Table = ({age, masculine, feminine, multiculuralAppearance}) => {

    const rowArray = multiculuralAppearance.map((concept) => {
        return (
           <tr>
              <td>{concept.name}</td>
              <td>{concept.value}</td>
           </tr>
        )
     })



    return(
        <div>
            <h1>My react table</h1>
            <table>
                <tbody>
                    <tr><th>Table header</th></tr>
                    <tr>
                        <td>{'Age appearance   '}</td>
                        <td>{'  probability'}</td>
                    </tr>
                    <tr>
                        <td>{age.name}</td>
                        <td>{age.value}</td>
                    </tr>
                </tbody>
            </table>
        </div>
    )
}


export default Table;
